sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.props = {};
  //outputs.props.blob = "blub";
  //outputs.propstr= '{ \"props\" : {\"blob\":\"blub\"}}'; 

  outputs.propstr = '{ \"props\" : {';
  for (i = 0; i < inputs.props.length; i++) {
    outputs.propstr += ' \"' + inputs.props[i].key + '\" : ';
    if (inputs.props[i].value) {
      outputs.propstr += '\"' + inputs.props[i].value + '\"';
    } else {
      outputs.propstr += "null";
    }
    if (i < inputs.props.length - 1) {
      outputs.propstr += ',';
    }
  }
  outputs.propstr += '}}'; 
  if (inputs.recursive == "true") {
    outputs.recursiveint = "1";
  } else {
    outputs.recursiveint = "0";
  }
})(inputs, outputs);

